import React, { Component } from "react";
import { Card } from "react-bootstrap";

class Cart extends Component {
  render() {
    return (
    	<body>
    	<h2 ><b><big>Welcome to the Piped Piper Store!</big></b></h2>
    	<h3><big>Powered by Alejandro Garcia</big></h3>
  		</body>
    );
  }
}

export default Cart;
